import React,{use} from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import SignUp from "./Shared/Component/SignUp";
import Header from "./Shared/Component/Header";
import MainPage from "./MuseyScreens/Component/LandingPages/MainPage";
import FeedBackBoard from "./MuseyScreens/Component/UserDashBoard/FeedBackBoard";
import YourBoard from "./MuseyScreens/Component/UserDashBoard/YourBoard";
import UploadBoard from "./MuseyScreens/Component/UserDashBoard/UploadBoard";
import AddImageBoard from "./MuseyScreens/Component/UserDashBoard/AddImageBoard";
import Forgot from "./Shared/Component/Forgot";
import EmailVerify from "./Shared/Component/EmailVerify"
import ImageRequestBoard from "./MuseyScreens/Component/UserDashBoard/ImageRequestBoard";
import ChangePassword from "./Shared/Component/ChangePassword";
import LogOut from "./Shared/Component/LogOut";

// You should replace this with actual authentication logic (e.g., using tokens, etc.).
const fakeAuth = {
  isAuthenticated: false,
  login: () => {
    fakeAuth.isAuthenticated = true;
  },
  logout: () => {
    fakeAuth.isAuthenticated = false;
  },
};

// AuthWrapper component to protect routes that require authentication
const AuthWrapper = ({ children }) => {
  // Replace this with actual authentication check using your preferred method (e.g., JWT, tokens, etc.).
  const [isAuthenticated, setIsAuthenticated] = useState(fakeAuth.isAuthenticated);

  if (!isAuthenticated) {
    // Redirect to login page if the user is not authenticated
    return <Navigate to="/signup" />;
  }

  // If authenticated, render the protected content
  return <>{children}</>;
};

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <Routes>
          <Route path="/" element={<MainPage />} />
          <Route path="/signup" element={<SignUp />} />
          <Route path="/forgot" element={<Forgot />} />
          <Route path="/logout" element={<LogOut />} />
          <Route path="/passwordchange" element={<ChangePassword />} />
          <Route path="/emailverified" element={<EmailVerify />} />

          {/* Protected routes wrapped in AuthWrapper */}
          <Route
            path="/yourboard"
            element={
              <AuthWrapper>
                <YourBoard />
              </AuthWrapper>
            }
          />
          <Route
            path="/uploadboard"
            element={
              <AuthWrapper>
                <UploadBoard />
              </AuthWrapper>
            }
          />
          <Route
            path="/addimage"
            element={
              <AuthWrapper>
                <AddImageBoard />
              </AuthWrapper>
            }
          />
          <Route
            path="/requestboard"
            element={
              <AuthWrapper>
                <ImageRequestBoard />
              </AuthWrapper>
            }
          />
          <Route
            path="/feedbackboard"
            element={
              <AuthWrapper>
                <FeedBackBoard />
              </AuthWrapper>
            }
          />
        </Routes>
      </BrowserRouter>
      {/* <ImageRequestBoard/>   */}
    </div>
  );
}

export default App;
